const http = async (a, b, c, d) => {
  try {
    const data = await fetch("http://localhost:5000/register", {
      method: "POST",
      crossDomain: true,
      headers: {
        "Content-Type": "application/json",
        Accept: "application/json",
        "Access-Control-Allow-Origin": "*",
      },
      body: JSON.stringify({
        fname: a,
        email: b,
        lname: c,
        password: d,
      }),
    });
    console.log(data, "userRegister");
  } catch (err) {
    console.log(err);
  }

  //   })
  //     .then((res) => res.json())
  //     .then((data) => {

  //     });
};

export default http;
